import {Link} from 'react-router-dom'
import Layout from '../Layout/Layout';

const LandingPage = () => {

      const renderLandingPage = () => (
          <Layout title="Save our Delicacies" background={true}
          backdrop={true}>

              <section>
                <h1 style={{color:'var(--primary-orange)', fontFamily:'Roboto Bold'}}>indiCafe</h1>
                <p>
                  <button className="btn btn-warning"
                  style={{padding:'5px 20px', fontWeight:'bold',
                  margin:'3px 10px'}}>
                    <Link to='/browse' style={{color:'inherit'}}>Explore</Link>
                  </button>Our offers and enjoy the savories
                </p>
                <p>
                  Home Deliveries under 30 min.
                </p>
                </section> 
          </Layout>
      )
    return (
        <>
          {renderLandingPage()}  
        </>
    )
}

export default LandingPage
